import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { environment } from "src/environments/environment";
import { ToDoDTOResponce } from "../interfaces/to-do-dto.interface";
import { Observable } from "rxjs";

@Injectable({
  providedIn: "root",
})
export class TodoService {
  private readonly TODO_URL = "/todos";

  constructor(private http: HttpClient) {}

  public getTodoList(): Observable<ToDoDTOResponce> {
    return this.http.get<ToDoDTOResponce>(
      `${environment.BASE_URL}${this.TODO_URL}`
    );
  }
}
